<!DOCTYPE html>
<html>
	<head>
		<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
		<meta name="viewport" content="width=device-width,initial-scale=1.0,maximum-scale=1.0,user-scalable=no,viewport-fit=cover">
		<link rel="preconnect" href="https://fonts.googleapis.com">
		<link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
		<link rel="preload" as="style" href="https://fonts.googleapis.com/css2?family=Material+Icons&display=swap" onload="this.rel='stylesheet'">
		<link rel="preload" as="style" href="https://fonts.googleapis.com/css2?family=Roboto:ital,wght@0,400;0,700;1,700&display=swap" onload="this.rel='stylesheet'">
		<link rel="icon" type="image/png" href="/img/icons/favicon-32x32.png" sizes="32x32">
		<meta property="og:url" content="https://" />
		<meta property="og:title" content="<%= htmlWebpackPlugin.options.title %>">
		<meta property="og:image" content="https:///promo.jpg">
		<meta property="og:image:type" content="image/jpg" />
		<meta property="og:image:width" content="1024" />
		<meta property="og:image:height" content="1024" />
		<meta property="og:description" content="">
		<meta name="description" content="">
		<meta name="robots" content="notranslate">
		<meta name="google" value="notranslate">
		<title><%= htmlWebpackPlugin.options.title %></title>
	</head>
	<body>
		<noscript><strong>We're sorry but <%= htmlWebpackPlugin.options.title %> doesn't work properly without JavaScript enabled. Please enable it to continue.</strong></noscript>
		<div id="app"></div>
	</body>
</html>
